import { NavLink } from "react-router-dom";
import "./panel.css";

function Panel() {
  return (
    <>
      <div className="App">
        <div className="canvas">main panel</div>
        <div className="panel">
          <NavLink
            to="/messages"
            className={({ isActive, isPending }) =>
              isPending ? "pending" : isActive ? "active" : ""
            }
          >
            Messages
          </NavLink>
          ;{" "}
        </div>
      </div>
    </>
  );
}

export default Panel;
